import {genreSlice} from "./index";

export const loadGenresIfNotExist = (dispatch, getState) => {
    fetch(" http://localhost:3001/api/genres")
        .then((response) => response.json())
        .then(genres => {
            console.log(genres)
            dispatch(genreSlice.actions.successLoading())
        }).catch(() => {

    })
}
